    false,nt"url": null,nt"notes": "The purpose of this paper is to analyze
    the Convention Between the United States of America and the Union of Soviet Socialist
    Republics Concerning the Conservation of Migratory Birds and Their Environment,
    signed November 19, 1976, (hereinafter referred to as "the Russian Convention")
    and to compare it with existing federal wildlife and other environmental legislation,
    emphasizing those aspects of the Russian Convention which are not implemented or
    not fully implemented by existing law. Included in this analysis is a discussion
    of various measures to be considered if the Fish and Wildlife Service determines
    to seek full legislative implementation of the Russian Convention.",nt"owner_org":
